example_uses:
increase transparency and openness of government;
improve access to CDPH data assets and help consumers to make informed public health decisions;
identify high priority areas where analytics can support CDPH's health reform strategy; and
create a streamlined process to make CDPH data assets available for innovation, economic development, and research with appropriate privacy, security and data use protections in place;
expand policy analysis and research using DOH and collaborators' data resources in key public health and health services delivery areas; and
contribute findings to the scientific evidence base, which will be used to improve public health and health services delivery programs' performance and ultimately, improve health

check out our blog: http://cdphopendata.tumblr.com/

description:
Recargo, Inc., provides software and services for plug-in electric vehicle drivers and industry. The company's offerings include: 

PlugShare, the EV charging station finder app; 
PluginCars.com - news, reviews and discussions for the EV and plug-in hybrid community; 
GreenCharge - a free iPhone app that provides a user-friendly way to view and manage your car's charging schedule and cost; 
ChargeManager - an easy-to-use online tool for organizations managing fleets of plug-in vehicles; 
PlugInsights - a research service with the mission to amplify the voice of the driver to automakers, charging providers, utilities, and policy makers.
